import Watch from "./Watch";

const List = ({ watches, save }) => {
    return ( 
        <div className="list">
            {watches && watches.map((car) => (
                <Watch watch={watches} key={watches.id} save={save}/>
            ))}
        </div>
     );
}

export default List;
